window.bookSummaryJSON = "<p>Ben Carter, pet care specialist, is hired to walk a Shiba Inu named Toby. Unbeknownst to Ben, Toby is no ordinary dog but an <i>inugami</i> - an immortal demon born in feudal Japan and bred for only one purpose...murder. </p> <p>A mysterious cult seeks to capture the <i>inugami</i> and harness its power for evil. With the help of an elderly luchador and a cop with a heart of gold, Ben must protect Toby and uncover the secret of the Tengu before the cultists can unleash the beast and the bloodlust claims the <i>inugami</i> once more. </p>"; 
